import logo from './logo.svg';
import './App.css';
import Philodendron from './Philodendron';
import { useState } from 'react';
import PlantMenu from './PlantMenu';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import PlantDashboard from './PlantDashboard';
import Syngonium from './Syngonium';
import Hoya from './Hoya';

function App() {
  const [pageTitle, setPageTitle] = useState("")
  return (
    <div className="App">
      <PlantMenu />
      <header className="App-header">
      <Router>
      <nav>
        <Link to="/">Home</Link>
        <Link to="/philodendron">Philodendron</Link>
        <Link to="/syngonium">Syngonium</Link>
        <Link to="/hoya">Hoya</Link>
      </nav>
      <Routes>
        <Route path="/" element={<PlantDashboard />} />
        <Route path="/philodendron" element={<Philodendron />} />
        <Route path="/syngonium" element={<Syngonium />} />
        <Route to="/hoya" element={<Hoya/>}>Hoya</Route>
      </Routes>
    </Router>
        {pageTitle === "" &&
          <img src={logo} className="App-logo" alt="logo" />
        }
        {pageTitle === "philodendron" &&
          <Philodendron />
        }
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Hello Bryan
        </a>
      </header>
    </div>
  );
}

export default App;
